I – não incidirá o encargo de que trata o art. 1º do Decreto–lei nº
1.025, de 21 de outubro de 1969;
II – será aplicado o disposto no § 9º–A do art. 25.

I – procedimentos de orientação tributária e aduaneira prévia;
II – não aplicação de eventual penalidade administrativa;
III – concessão de prazo para o recolhimento de tributos
devidos sem a aplicação de penalidades;
IV – redução de multa de ofício em pelo menos 1/3 (um terço) e
de multa de mora em pelo menos 50% (cinquenta por cento);
V – prioridade de análise em processos administrativos,
inclusive quanto a pedidos de restituição, compensação ou ressarcimento de
direitos creditórios;
VI – atendimento preferencial em serviços presenciais ou
virtuais.

I – regularidade cadastral;
II – histórico de regularidade fiscal do sujeito passivo;
III – compatibilidade entre escriturações ou declarações e os
atos praticados pelo contribuinte;
IV – consistência das informações prestadas nas declarações e
escriturações.

I – serão reduzidos em 100% (cem por cento) no caso de
pagamento à vista;
II – serão reduzidos em 75% (setenta e cinco por cento) no
caso de pagamento em até 12 (doze) parcelas;
III – serão reduzidos em 50% (cinquenta por cento) no caso de
pagamento em até 30 (trinta) parcelas;
IV – serão reduzidos em 25% (vinte e cinco por cento) no caso
de pagamento em até 48 (quarenta e oito) parcelas; ;
V – não serão reduzidos caso o sujeito passivo opte pelo
pagamento em 49 (quarenta e nove) ou mais parcelas.
